DROP TABLE IF EXISTS public.PEDIDO_ITEM;
DROP TABLE IF EXISTS public.PEDIDO;
DROP TABLE IF EXISTS public.STATUS;
DROP TABLE IF EXISTS public.PRODUTO;
DROP TABLE IF EXISTS public.SUB_GRUPO;
DROP TABLE IF EXISTS public.GRUPO;
DROP TABLE IF EXISTS public.CONTA_RECEBER;
DROP TABLE IF EXISTS public.CLIENTE;
DROP TABLE IF EXISTS public.CIDADE;

CREATE TABLE public.CIDADE (
  ID SERIAL PRIMARY KEY,
  DESCRICAO varchar(255)
);


CREATE TABLE public.CLIENTE (
  ID SERIAL PRIMARY KEY,
  NOME varchar(255) default NULL,
  CIDADE integer NULL,
  EMAIL varchar(255) default NULL
);


CREATE TABLE public.CONTA_RECEBER (
  ID SERIAL PRIMARY KEY,
  DOCUMENTO integer NULL,
  PARCELA integer NULL,
  EMISSAO date default current_date,
  VENCIMENTO date default current_date,
  VALOR money default 0
);


CREATE TABLE public.GRUPO (
  id SERIAL PRIMARY KEY,
  DESCRICAO varchar(255) default NULL
);


CREATE TABLE public.SUB_GRUPO (
  id SERIAL PRIMARY KEY,
  DESCRICAO varchar(255) default NULL
);


CREATE TABLE public.PRODUTO (
  id SERIAL PRIMARY KEY,
  DESCRICAO varchar(255) default NULL,
  GRUPO integer NULL,
  SUB_GRUPO integer NULL,
  STATUS integer NULL,
  estoque numeric(14,2) NULL
);


UPDATE public.PRODUTO
SET STATUS = 1
WHERE STATUS = 0 AND ID > 100;

UPDATE public.PRODUTO
SET DESCRICAO = 'PRODUTO ' || ID;

COMMIT;

CREATE TABLE public.PEDIDO (
  ID SERIAL PRIMARY KEY,
  EMISSAO DATE NOT NULL default current_date,
  CLIENTE integer NOT NULL,
  STATUS integer NOT NULL default 1,
  VALOR money NOT NULL default 0
);


CREATE TABLE public.PEDIDO_ITEM (
  ID SERIAL PRIMARY KEY,
  PRODUTO integer NULL,
  QUANTIDADE numeric(2) default NULL,
  VALOR_UNITARIO money default NULL,
  PERC_DESCONTO numeric(2) NULL,
  PEDIDO integer NULL
);


CREATE TABLE public.STATUS (
  ID SERIAL PRIMARY KEY,
  DESCRICAO varchar(255) default NULL
);


commit;

